  JMACLEAN, Kirsty Mary and COLLISTER, Paul Christopher
  02> MACLEAN, Kirsty Mary m on 03.05.1985 to COLLISTER, Paul Christopher
  b 27.09.1951
  b 26.10.1958
  Kirsty b. at Gisborne and m. at Auckland. Paul, s/o George Christopher Collister and Winifred Mary
  Kearns, b. at Liverpool, England. Address: 23 Stratford Street, Parnell, Auckland.
  Kirsty grew up in Puha, Gisborne and was educated at Auckland Diocesan School for Girls. She
  trained as a nurse at Greenlane Hospital and is currently working as a practice nurse in Parnell,
  Auckland.
  Paul emigrated to Auckland, New Zealand at the age of nine and was educated at Westlake Boys'
  School. He graduated MEng from Auckland University and is currently working for an engineering
  consultancy in Auckland.
  b1> COLLISTER, Emma Louise
  b 21.03.1986
  Emma b. at Auckland. She is a pupil at Parnell District School.
  b2> COLLISTER, Jeremy Paul
  b 04.08.1988
  Jeremy b. at Auckland. He is a pupil at Parnell District School.
  02> 'MACLEAN, Peter Alloway m on 22.07.1944 to (1) HAWKINS, Felicity Anne
  b 11.04.1920
  b ** ** **** d 10.08.1982
  Peter b. at Gisborne and m. at Fremantle, Western Australia. Felicity, d/o George Blundell-Bruce
  Hawkins and ?? Stapleton, b, at Bombay, India, d. at Sydney, NSW and bd. at Chatswood, NSW.
  Felicity was a nursing sister. She joined Qantas and later she was involved in community nursing at
  the University of New South Wales.
  01> MACLEAN, Alloway Anne m on 03.05.1964 to EVANS, Grahame Edwyn.
  b 25.05.1945
  b 28.05.1944
  Anne b. at Subiaco, Perth, Western Australia and m. at All Saints' Church, Ainslie, ACT. Grahame,
  s/o Roy Thomas Evans and Mavis Adelaide Rice, b. at Armidale, NSW. Address: 9 Oceanside Drive,
  Caves Beach 2182, Newcastle, NSW, Australia.
  Anne was educated at Abbotsleigh Private School in Sydney and Canberra Girls' Grammar School in
  ACT. She trained as a medical technician then worked as a clerk in the ACT Public Service. She is
  now a Tupperware dealer.
  Grahame was educated at various schools in New South Wales, gaining his Intermediate Certificate at
  Braidwood Central School. He joined the Commercial Bank of Australia Ltd and advanced to manager
  at St Marys, assistant manager at Canberra and manager at Newcastle West then Blacktown. Following
  the merger with the Bank of New South Wales to form Westpac, he was manager at Blacktown Central,
  Wentworthville, Auburn and Bankstown then commercial manager at Gosford. He retired in 1995 due to
  ill health.
  01> EVANS, Raymond Peter Roy
  b 11.08.1971
  Raymond b. at Canberra, ACT, Address: 8 John Street, Arncliffe 2205, Sydney, NSW, Australia.
  Ray was educated at Rosebank Avenue Primary School, Greystanes, Sydney, NSW; Weston Primary
  School, Weston, Canberra, ACT; Adamstown Heights Primary School, Newcastle, NSW; West Pennant
  Hills Primary School, Sydney, NSW; and Carlingford High School, Carlingford, NSW. He graduated
  BCom in Management from the University of Western Sydney then joined Philips Lighting in 1992.
  He is currently employed by them as Wholesale Representative. He is also undertaking a Master
  of Commerce in Information Systems and Management at the University of NSW, Kensington, Sydney.
